// ==UserScript==
// @name           343 Annoying Spark
// @author         PKF 647, orig concept by aeosynth
// @description    Adds 343 Guilty spark fly by to bungie.net
// @include        Http://*.bungie.net/*
// @license        WTFPL; http://sam.zoy.org/wtfpl/COPYING
// ==/UserScript==

const monitor = "data:image/png;base64,"
function add(){
	var img=document.createElement('img')
	img.src=monitor
	img.style.top=Math.random()*(document.body.clientHeight-img.offsetHeight)+'px'
	img.style.left='0px'
	img.style.position='Absolute'
	document.body.appendChild(img)
	spark.push(img)
}
function move(){
	for(i in spark){
		var x=parseInt(spark[i].style.left)
		if(x<document.body.clientWidth-spark[i].offsetWidth-3)
			spark[i].style.left=x+3+'px'
		else
			document.body.removeChild(spark.shift())
	}
}
function start(){
	setInterval(add,7000)
	setInterval(move,10)
}
var spark=[]
GM_registerMenuCommand('Activate Monitor 343 "Guilty Spark"',start)